import React from "react";

const InfoList = ({ users, todos, projects }) => {
  console.log();
  return (
    <table className="table table-bordered">
      <thead>
        <tr>
          <th>TODO</th>
          <th>PROJECT</th>
          <th>USERS</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>{todos.length}</td>
          <td>{users.length}</td>
          <td>{projects.length}</td>
        </tr>
      </tbody>
    </table>
  );
};

export default InfoList;
